import { Button } from "@mui/material";


const MuiButton = () => {
  return (
    <div>
      <Button variant='text'>Text</Button>
      <Button variant='contained'></Button>
      <Button variant='outlined'>Text</Button>
      </div>
  )
}

export default MuiButton
